// import React from "react";
import Link from "next/Link";

export default function NavBar() {
  return (
    <>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
    </>
  );
}
